import React from 'react';
import {connect} from 'react-redux';

const Fav = (props) => {
    return (
        <div>
            <ul>
            {props.data.map((elm,idx)=>
            <li key={idx}>{elm}</li>
            )}
            </ul>
        </div>
    );
};

const mapStateToProps = (state) => {
    return{
        data: state.favResults
    }
}

export default connect(mapStateToProps)(Fav);
